import Customers.Customers;

import javax.servlet.ServletException;
import javax.servlet.annotation.WebServlet;
import javax.servlet.http.HttpServlet;
import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;
import java.io.IOException;
import java.util.ArrayList;
import java.util.List;

@WebServlet(name = "CustomersServlet", urlPatterns = "/customers")
public class CustomersServlet extends HttpServlet {
    private static List<Customers> customerList = new ArrayList<>();

    static {
        customerList.add(new Customers("Phạm Quang Vinh", "12-04-1999", "Đà Nẵng", "data:image/jpeg;base64,"));
        customerList.add(new Customers("Phạm Thế Sơn", "12-05-1999", "Hà Nội", "data:image/jpeg;base64,"));
        customerList.add(new Customers("Hoàng Đức Danh", "13-06-1999", "Hồ Chí Minh", "data:image/jpeg;base64,"));
        customerList.add(new Customers("Lê Bá Hoàng Danh", "14-08-1999", "Huế", "data:image/jpeg;base64,"));
        customerList.add(new Customers("Nguyễn Thanh Hải", "22-12-1999", "Đà Lạt", "data:image/jpeg;base64,"));
    }

    protected void doPost(HttpServletRequest request, HttpServletResponse response) throws ServletException, IOException {
        request.setCharacterEncoding("UTF-8");
        response.setContentType("text/html;charset=UTF-8");

        request.setAttribute("customerList", customerList);
        request.getRequestDispatcher("/customer.jsp").forward(request, response);
    }

    protected void doGet(HttpServletRequest request, HttpServletResponse response) throws ServletException, IOException {
        request.setCharacterEncoding("UTF-8");
        response.setContentType("text/html;charset=UTF-8");

        request.setAttribute("customerList", customerList);
        request.getRequestDispatcher("/customer.jsp").forward(request, response);
    }
}
